import React, { Component } from "react";
import StudentHome from "./studentHome";

export const StudentHomePage = () => (
  <div>
    <StudentHome />
  </div>
);

export const CourseListPage = () => (
  <div>
    <h3>Course List Page</h3>
  </div>
);

export const LogOut = () => (
  <div>
    <h3>Log out page</h3>
  </div>
);
